import { Link } from "react-router-dom"
import styles from "../components/layout/Cadastrar.module.css"
import { Button } from "@mui/material"
import styleButton from "../components/layout/StyleButton.module.css"
import styleBotaoCheck from "../components/layout/BotaoCheck.module.css"
import React, { useState } from "react";


function Cadastrar() {
    let selecionados = [];

    const [userinfo, setUserInfo] = useState({
        languages: [],
        response: [],
    });

    selecionados = selecionados.concat(userinfo.languages)
    const [primeiro, setPrimeiro] = useState(true);
    const [outro, setOutro] = useState(true);
    const [vale, setVale] = useState(true);
    const [dependentes, setDependentes] = useState(false);
    const [seguro, setSeguro] = useState(true);

    selecionados.push(primeiro)
    selecionados.push(outro)
    selecionados.push(seguro)
    selecionados.push(vale)
    selecionados.push(dependentes)
    const [inputs, setNome] = useState([]);

    const handleChange = (e) => {
        const { value, checked } = e.target;
        const { languages } = userinfo;
        if (checked) {
            setUserInfo({
                languages: [...languages, value],
                response: [...languages, value],
            });
        }
        else {
            setUserInfo({
                languages: languages.filter((e) => e !== value),
                response: languages.filter((e) => e !== value),
            });
        }
    };
    const ChangeOpcPrimeiro = (e) => {
        setPrimeiro(e.target.value)
    }
    const ChangeOpcDependentes = (e) => {
        setDependentes(e.target.value)
        console.log(dependentes)
    }
    const ChangeOpcVale = (e) => {
        setVale(e.target.value)
    }
    const ChangeOpcOutro = (e) => {
        setOutro(e.target.value)
    }
    const ChangeOpcSeguro = (e) => {
        setSeguro(e.target.value)
    }
    // function handleAddInput() {
    //     setInputValues(inputValues.concat(''));
    // }

    // function handleRemoveInput(index) {
    //     setInputValues(inputValues.filter((_, i) => i !== index));
    // }

    function handleInputChange(event, index) {
        const newValues = [...nome];
        newValues[index] = event.target.value;
        setNome(newValues);
    }
    return (
        <div className="App">
            <header className="App-header">
                Cadastro
            </header>
            <br></br>
            <div className={styles.campos}>
                <form className={styles.form}>
                    <p className={styles.h1pe}>Informações Pessoais</p>
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="Nome" type="text" className={styles.input} />
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="Data de Nascimento" type="text" className={styles.input} />
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="Nacionalidade" type="text" className={styles.input} />
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="Naturalidade" type="text" className={styles.input} />
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="Grau de Instrução" type="text" className={styles.input} />
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="Estado Civil" type="text" className={styles.input} />
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="Sexo" type="text" className={styles.input} />
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="Raça" type="text" className={styles.input} />
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="Filiação" type="text" className={styles.input} />
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="CPF" type="text" className={styles.input} />
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="E-mail" type="text" className={styles.input} />
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="Tipo Sanguíneo" type="text" className={styles.input} />
                    <p className={styles.h1pe}>Endereço</p>
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="Bairro" type="text" className={styles.input} />
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="Cidade" type="text" className={styles.input} />
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="Nº Residencia" type="text" className={styles.input} />
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="UF" type="text" className={styles.input} />
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="CEP" type="text" className={styles.input} />
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="Telefone" type="text" className={styles.input} />
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="País" type="text" className={styles.input} />
                    <p className={styles.h1pe}>RG</p>
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="Orgão Emissor" type="text" className={styles.input} />
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="UF Emissão" type="text" className={styles.input} />
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="Data Emissão" type="text" className={styles.input} />
                    <p className={styles.h1pe}>Carteira de Habilitação</p>
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="Categoria" type="text" className={styles.input} />
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="Numero" type="text" className={styles.input} />
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="Vencimento" type="text" className={styles.input} />
                    <p className={styles.h1pe}>Título de Eleitor</p>
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="Zona" type="text" className={styles.input} />
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="Seção" type="text" className={styles.input} />
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="Número" type="text" className={styles.input} />
                    <p className={styles.h1pe}>Carteira de Trabalho</p>
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="Número" type="text" className={styles.input} />
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="Série" type="text" className={styles.input} />
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="UF" type="text" className={styles.input} />
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="Emissão" type="text" className={styles.input} />
                    <p className={styles.h1pe}>PIS</p>
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="Número" type="text" className={styles.input} />
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="Emissão" type="text" className={styles.input} />
                    <p className={styles.h1pe}>Militar</p>
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="Número" type="text" className={styles.input} />
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="Emissão" type="text" className={styles.input} />
                    <p className={styles.h1pe}>Primeiro Emprego?</p>
                    <input className={styleBotaoCheck.input} type="checkbox" name="check" value="Sim"
                        onChange={ChangeOpcPrimeiro}></input>
                    <p className={styles.text}>Sim</p>
                    <input className={styleBotaoCheck.input} type="checkbox" name="check" value="Não"
                        onChange={ChangeOpcPrimeiro}></input>
                    <p className={styles.text}>Não</p>
                    <p className={styles.h1pe}>Possui outro vinculo empregatício?</p>
                    <input className={styleBotaoCheck.input} type="checkbox" name="check" value="Sim"
                        onChange={ChangeOpcOutro}></input>
                    <p className={styles.text}>Sim</p>
                    <input className={styleBotaoCheck.input} type="checkbox" name="check" value="Não"
                        onChange={ChangeOpcOutro}></input>
                    <p className={styles.text}>Não</p>
                    <p className={styles.h1pe}>Está recebendo seguro desemprego?</p>
                    <input className={styleBotaoCheck.input} type="checkbox" name="check" value="Sim"
                        onChange={ChangeOpcSeguro}></input>
                    <p className={styles.text}>Sim</p>
                    <input className={styleBotaoCheck.input} type="checkbox" name="check" value="Não"
                        onChange={ChangeOpcSeguro}></input>
                    <p className={styles.text}>Não</p>
                    <p className={styles.h1pe}>Qual vale deseja receber?</p>
                    <input className={styleBotaoCheck.input} type="checkbox" name="check" value="Sim"
                        onChange={handleChange}></input>
                    <p className={styles.textlongo}>Vale Alimentação</p>
                    <input className={styleBotaoCheck.input} type="checkbox" name="check" value="Não"
                        onChange={handleChange}></input>
                    <p className={styles.textlongor}>Vale Refeição</p>
                    <p className={styles.h1pe}>Necessita de vale transporte?</p>
                    <input className={styleBotaoCheck.input} type="checkbox" name="check" value="Sim"
                        onChange={ChangeOpcVale}></input>
                    <p className={styles.text}>Sim</p>
                    <input className={styleBotaoCheck.input} type="checkbox" name="check" value="Não"
                        onChange={ChangeOpcVale}></input>
                    <p className={styles.text}>Não</p>
                    <p className={styles.h1pe}>Possui dependentes?</p>
                    <input className={styleBotaoCheck.input} type="checkbox" name="check" value="true"
                        onChange={ChangeOpcDependentes}></input>
                    <p className={styles.text}>Sim</p>
                    <input className={styleBotaoCheck.input} type="checkbox" name="check" value="false"
                        onChange={ChangeOpcDependentes}></input>
                    <p className={styles.text}>Não</p>
                    <br></br>
                    {dependentes === "true" && <div>
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="Nome dependente" type="text" className={styles.input} />
                    <input onchange={(e) => handleInputChange(e, 1)} placeholder="Nascimento dependente" type="text" className={styles.input} />
                    </div>}
                </form>
            </div>
            <br></br>
            <Link to={"/menu"} className={styleButton.button}>Cadastrar</Link>
            <Button class={styleButton.button} href="/menu" size="small">Voltar</Button>
        </div>
    )
}

export default Cadastrar
